import { StyledPlayArea } from './PlayArea.styles';
class PlayArea extends React.PureComponent {
  render() {
    return (
      <StyledPlayArea
        {...this.props}
      >
        Sprint Deadline
      </StyledPlayArea>
    )
  }
};

export default PlayArea;
